import { Component } from '@angular/core';
import dataObj from '../assets/api-response.json';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'rouse-challenge';
  data: any[];
  modelIds: any[];
  constructor() {
    this.data = []
    this.modelIds = []
    Object.keys(dataObj).map((key) => {
      let id: any = dataObj[key as keyof DataPoint].classification.model
      this.data.push(id);
      return this.data;
    });
  }


}

interface DataPoint  {
  key:
        schedule: {
            years: {
                year: {
                    marketRatio: number;
                    auctionRatio: number;
                };
            };
            defaultMarketRatio: number;
            defaultAuctionRatio: number;
        };
        saleDetails: {
            cost: number;
            retailSaleCount: number;
            auctionSaleCount: number;
        };
        classification: {
            category: string;
            subcategory: string;
            make: string;
            model: string;
        };
        };
};
